" <div id=\"topicContent\">",
"  <div id=\"topicTitle\">",
"   Management of normal labor and delivery",
"  </div>",
"  <div id=\"topicContributors\">",
"   <div>",
"    <a id=\"authors\">",
"    </a>",
"    <a class=\"contributor contributor_credentials contributorType\" href=\"mobipreview.htm?32/21/33114/contributors\">",
