var title_f32_21_33115="Risk factors ICH warfarin";
var content_f32_21_33115=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=HEME%2F76220&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=4\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=HEME%2F76220&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=4\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Risk factors for intracerebral hemorrhage during warfarin anticoagulation",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Firmly established risk factors",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Advancing age (especially &gt;75 years)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Hypertension (especially systolic blood pressure &gt;160 mmHg)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        History of cerebrovascular disease",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Intensity of anticoagulation",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Possible risk factors",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Concomitant use of aspirin",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Cerebral amyloid angiopathy",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Asian or Mexican-American ethnicity",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Tobacco smoking",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Heavy alcohol consumption",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Imaging and genetic markers",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Leukoaraiosis detected by brain CT/MRI",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Microbleeds by T2*-weighted MRI",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        APOE epsilon II or IV genotype",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     CT: computed tomography; MRI: magnetic resonance imaging.",
"    </div>",
"    <div class=\"reference\">",
"     Reproduced with permission from: Hart RG, Tonarelli SB, Pearce LA. Avoiding central nervous system bleeding during antithrombotic therapy: Recent data and ideas. Stroke 2005; 36:1588. Copyright &copy; 2005 Lippincott Williams &amp; Wilkins.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
